import React, { Component } from 'react'
import PokeCards from './PokeCards'
import './AppComponentStyles.css'


export default class AppComponent extends Component {
  render() {
    return (
      <div className='App'>
        <PokeCards
        id={4}
        name='Charmander'
        type='fire'
        base_experience={62}
        />
      </div>
    )
  }
}
